import * as React from "react";
import './footer.css';

export default class footer extends React.Component {

    render() {
        return (
            <div id="footer">
                <div className="row">
                    <div className="col">
                        <p>&copy;{new Date().getFullYear} MarcusMathiesen ApS </p> <p>|</p> <p> All rights reserved  </p> <p>|</p> <p>  <a href="../contact">Contact</a> </p>
                    </div>
                </div>
                <div className="row">

                </div>
            </div>
        );
    }
}
